  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;63f06283b80a395adf27780d&quot;
  },
  &quot;suppliers&quot;: [
    {
      &quot;name&quot;: &quot;S1&quot;,
      &quot;duesPaid&quot;: true
    },
    {
      &quot;name&quot;: &quot;S2&quot;,
      &quot;duesPaid&quot;: true
    }
