  },
  &quot;suppliers&quot;: [
    {
      &quot;name&quot;: &quot;S1&quot;,
      &quot;duesPaid&quot;: true
    },
    {
      &quot;name&quot;: &quot;S2&quot;,
      &quot;duesPaid&quot;: false
    }
  ]
}]
</code></pre>
<p>I would like to create an aggregate field in each document that does the following: If the <code>suppliers</code> array has at least 1 element and every element in that has the <code>duesPaid == true</code>, then add a field to the document <code>suppliersPaid = true</code>. Otherwise, add <code>suppliersPaid = false</code>. The resulting documents from the pipeline should look like this:</p>
<pre class="lang-json prettyprint-override"><code>[{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;63f06283b80a395adf27780d&quot;
  },
  &quot;suppliers&quot;: [
    {
      &quot;name&quot;: &quot;S1&quot;,
      &quot;duesPaid&quot;: true
    },
    {
      &quot;name&quot;: &quot;S2&quot;,
      &quot;duesPaid&quot;: true
    }
  ],
  &quot;suppliersPaid&quot;: true,
},{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;63f06283b80a395adf27780e&quot;
  },
  &quot;suppliers&quot;: [
    {
      &quot;name&quot;: &quot;S1&quot;,
      &quot;duesPaid&quot;: true
    },
    {
      &quot;name&quot;: &quot;S2&quot;,
      &quot;duesPaid&quot;: false
    }
  ],
  &quot;suppliersPaid&quot;: false,
}]
</code></pre>
<p>I have tried the following pipeline:</p>
<pre><code>[{$addFields: {
  suppliersPaid: {
    $and: [
      { $gte: [{ $size: &quot;$suppliers&quot; }, 1] },
      {
        suppliers: {
          $not: {
            $elemMatch: { duesPaid: false },
          },
        },
      },
    ],
  },
}}]
</code></pre>
<p>and I get the following error:</p>
<blockquote>
<p>Invalid $addFields :: caused by :: Unrecognized expression '$elemMatch'</p>
