<pre><code>[{$addFields: {
  suppliersPaid: {
    $and: [
      { $gte: [{ $size: &quot;$suppliers&quot; }, 1] },
      {
        suppliers: {
          $not: {
            duesPaid: false
          },
        },
      },
    ],
  },
}}]
</code></pre>
<p>But this yields the incorrect result of setting <code>suppliersPaid</code> to true for both documents, which is incorrect.</p>
<p>Note: I would like to avoid using any sort of JS in this code i.e. no <code>$where</code> operator.</p>

